import React from 'react';
import './App.css';

import MyHeader from './MyHeader';
import MyFooter from './MyFooter';
import Counter from './Counter';

function App() {
  let name = 'taegyun'
  const number = 6
  const counterProps = {
    a :1,
    b :2,
    c :3,
    d:4,
    e:5,
    initialValue:5
  }
  return (
    <div className="App">
      <MyHeader />
      <Counter counterProps/>
    </div>
  );
}
// jsx의 특징
